import React from "react";
import "../css/videojuego.css";

function Videojuego() {
    return (
        <div className="contenedor-videojuego">
                <div className="row">
                    <div className="col-8">
                        <div className="row-informacion">
                            <div className="col-4">
                                <img src="odbo/public/imagenes/vj3.png" class="img-thumbnail" alt="..." />
                            </div>
                        </div>
                    </div>
                    <div className="col-4">

                    </div>
                </div>
        </div>
    );
} 

export default Videojuego;
